import React from 'react';

function Station() {
  return (
    <div className="station">
        <svg height="50" width="50">
            <circle cx="25" cy="25" r="40" stroke="black" stroke-width="3" fill="red" />
        </svg>
    </div>
  );
}

export default Station;
